import React from "react";
import Slider from "react-slick";
import ExternalItem from "./ExternalItem";

const ExternalWebsites = props => {
    const externalLinks = [
        {
            id : 0, path : "", title : "", caption : "test1"
        },
        {
            id : 1, path : "", title : "", caption : "test2"
        },

    ]

    const carousel = externalLinks.map((link,index) => (
        <div key={index}>
            <ExternalItem link={link} key={index} />
        </div>
    ));

    const settingsThumbs = {
        speed: 1000,
        slidesToShow: 2,
        slidesToScroll: 1,
        dots: false,
        arrows: true,
        centerMode: true,
        focusOnSelect: true,
        centerPadding: '5px',
        zIndex:0,
        position:'relative',
        responsive:[
          {
            breakpoint: 480,
            settings: {
                slidesToShow: 1,
            }
          },
          {
            breakpoint: 600,
            settings: {
                slidesToShow: 1,
            }
          },
          {
            breakpoint: 1025,
            settings: {
                slidesToShow: 2,
            }
          }
        ]
    };

    return (
        <>
            <article style={{width:"initial"}} className="message is-link is-size-5">
                <div className="message-header">
                    <p> External Links </p>
                </div>
                <div className="message-body">
                    <div>
                        <div> 
                            {<Slider {...settingsThumbs}>
                                {carousel}
                            </Slider>}
                        </div>
                    </div>

                </div>
            </article>
        </>
    )
}
export default ExternalWebsites;
